import styled from 'styled-components'

const TimeBox = ({ props }) => {
    const {name, icon, data} = props
    return <Wrapper>
        <Cover>
            {content}
            <Circle />
        </Cover>
    </Wrapper>
}

const Circle = styled.div`
    height: 10px;
    width: 10px;
    border-radius: 50%;
    position: absolute;
`

const Cover = styled.div`
    position: relative;
    border-left: 1px solid rgb(251,189,136);
    padding-bottom: 10px;

`

const Wrapper = styled.div`
    margin: 5px;
`

export default TimeBox
